import React, { useEffect, useState } from 'react';
import Style from '../Openings/Openings.module.css';
import { Heading } from '../Heading/Heading';
import { Button } from '../Button/Button';

export const Openings = () => {
  const [openingsJson, setopeningsJson] = useState([]);


  useEffect(() => {
    fetchCallForDepartments();
  }, []);

  const fetchCallForDepartments = () => {
    fetch("http://localhost:8080/JobVista/AGetOp", {
      method: 'GET',
      headers: {
        'Content-type': 'Application/JSON'
      }
    })
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then(result => {
        console.log("Fetched data:", result);
        console.log("Departments:", result.message);
        setDepartmentJson(result.message.departments);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }

  return (
    <div>Openings</div>
  )
}
